DROP TABLE IF EXISTS "aeroporto";

CREATE TABLE "aeroporto" (
  citta varchar(255) PRIMARY KEY,
  nazione varchar(255) default NULL,
  numpiste integer NULL
);

DROP TABLE IF EXISTS "aereo";

CREATE TABLE "aereo" (
  modelloaereo varchar(255) PRIMARY KEY,
  numPasseggeri integer NULL
);

DROP TABLE IF EXISTS "volo";

CREATE TABLE "volo" (
  idVolo integer NULL,
  data date,
  cittaPart varchar(255) default NULL,
  cittaArr varchar(255) default NULL,
  tipoAereo varchar(255) default NULL,
  PRIMARY KEY(idVolo,data),
  FOREIGN KEY(cittaPart) REFERENCES aeroporto(citta),
  FOREIGN KEY(cittaArr) REFERENCES aeroporto(citta),
  FOREIGN KEY(tipoAereo) REFERENCES aereo(modelloaereo)
);




